.text 
.globl main

main:
	j drawStartPage

s_press:
	#global variables of the objects
	li $a1, 0x1000AA70 
	li $s5, 0x10009C3C
	li $s2, 0x10008260
	li $s3, 0x1000904C
	li $s4, 0x10009E44
	li $s1, 0x10009674
	li $s7, 0x1000b360
	li $a3, 0x1000ac28
	
	jal Background 
	jal drawClouds
	jal movdraw_normal_Platform3
	jal draw_normal_Platform
	jal movdraw_normal_Platform
	jal movdraw_normal_Platform2
	jal award  
	jal fire
	jal drawCharacter
	
			
		
main_loop:
	li $a2, 0xffff0000
	lw $t8, 0($a2)
	andi $t8, $t8, 0x0001
	beq $t8, $zero, charloop
	jal keypress
	
	
keypress:
	#jal scroll
	li	$t1, NEXT_ROW
	li	$t2, BASE_ADDRESS
	addi	$t2, $t2, NEXT_ROW
	li	$t3, LAST_ADDRESS
	addi	$t3, $t3, -CHAR_END
	addi	$t3, $t3, -NEXT_ROW
	
	lw	$t0, 4($a2)
	beq	$t0, 0x61, key_a						# ASCII code of 'a' is 0x61 or 97 in decimal
	beq	$t0, 0x77, key_w						# ASCII code of 'w' is 0x77
	beq	$t0, 0x64, key_d						# ASCII code of 'd' is 0x64
	beq	$t0, 0x70, key_p						# ASCII code of 'p' is 0x70

	# go left
	key_a:
		div	$a1, $t1
		mfhi	$t9						
		beq	$t9, $zero, keypress_done
		jal clearCharacter2
		jal move_left				

		b keypress_done
	# go up
	key_w:
		blt	$a1, $t2, keypress_done	
		jal clearCharacter2									
		jal move_up			
		b keypress_done

	# go right
	key_d:
		div	$a1, $t1						
		mfhi	$t9							
		addi	$t1, $t1, -48						
		beq	$t9, $t1, keypress_done					
		jal clearCharacter2		
		jal move_right			
		b keypress_done
		
	key_p:
		# restart game
		jal drawStartPage
		b keypress_done

	keypress_done:
		j main_loop						
		
	
move_right: 
	add $a1, $a1, 8
	li $t0, BASE_ADDRESS
	
	add $a2, $a1, $t0
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	jal drawClouds
	jal draw_normal_Platform
	jal movdraw_normal_Platform
	jal movdraw_normal_Platform2
	jal movdraw_normal_Platform3
	jal award  
	jal fire
	jal drawCharacter
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

move_left: 
	add $a1, $a1, -8
	li $t0, BASE_ADDRESS
	
	add $a2, $s0, $t0
	addi $sp, $sp, -4
	sw $ra, 0($sp)	
	
	jal drawClouds
	jal draw_normal_Platform
	jal movdraw_normal_Platform
	jal movdraw_normal_Platform2
	jal movdraw_normal_Platform3
	jal award  
	jal fire
	jal drawCharacter
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
move_up: 
	
	add $a2, $a1, $t0
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	add $a1, $a1, -256
	jal drawClouds
	jal draw_normal_Platform
	jal movdraw_normal_Platform
	jal movdraw_normal_Platform2
	jal movdraw_normal_Platform3
	jal award  
	jal fire
	jal drawCharacter
	li $v0, 32    # load 32 into register $v0 to trigger the sleep system call
	li $a0, 100  # load the number of milliseconds to sleep into register $a0
	syscall
	jal clearCharacter2
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	

	
gravity:
	addi	$sp, $sp, -4
	sw	$ra, 0($sp)
	
	jal clearCharacter2
	jal clearaward
	jal drawClouds
	add $a1, $a1, 256
	jal draw_normal_Platform
	jal movdraw_normal_Platform
	jal movdraw_normal_Platform2
	jal movdraw_normal_Platform3
	jal award  
	jal fire
	jal drawCharacter
	bgt $s3 0x1000C000 initialize
	bgt $s7 0x1000C000 initialize3
	bgt $s4 0x1000C000 initialize2
	bgt $a3 0x1000C000 initialize4
	li $v0, 32    # load 32 into register $v0 to trigger the sleep system call
	li $a0, 23  # load the number of milliseconds to sleep into register $a0
	syscall
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	move 	$t0, $a1
	
checkaward:
	addi $t0, $a1, 0x9F8
    	lw $t2 0($t0)
    	beq $t2, AWARD, drawwon
    	addi $t0, $a1, 0x90C
    	lw $t2 0($t0)
	beq $t2, AWARD, drawwon
		

checkfire:
	addi $t0, $a1, 0x9F8
    	lw $t2 0($t0)
    	beq $t2, RED, drawgameover
    	addi $t0, $a1, 0x90C
    	lw $t2 0($t0)
	beq $t2, RED, drawgameover

checkfalling:
	addi $t0, $a1, 0x9F8
	bgt $t0 0x1000C000 drawgameover
    	addi $t0, $a1, 0x90C
	bgt $t0 0x1000C000 drawgameover

	
checkplatforms:	
    addi $t0, $a1, 0x9F8
    lw $t2 0($t0)
    beq $t2, LIGHT_GREEN, stop
    addi $t0, $a1, 0x90C
    lw $t2 0($t0)
    beq $t2, LIGHT_GREEN, stop
    lw $t2 0($t0)
    j continue

	
continue:
	j gravity

stop:
	jr $ra

initialize:
	li $s3 0x1000874C
	addi $s3 $s3 512
	j moveplatforms

initialize2:
	li $s4 0x10008644
	addi $s4 $s4 512
	j moveplatforms
	
initialize3:
	li $s7 0x10008760
	addi $s7 $s7 512
	j moveplatforms

initialize4:
	li $a3 0x10008728
	addi $a3 $a3 512
	j moveplatforms
charloop:
	addi	$sp, $sp, -4
	sw	$ra, 0($sp)
	
	jal clearCharacter2
	jal clearfire
	jal clearaward
	jal clearPlatform
	jal movclearPlatform
	jal movclearPlatform2
	jal movclearPlatform3
	jal drawClouds
	add $s5 $s5 8
	add $s2 $s2 4
	add $a1, $a1, -256
	jal draw_normal_Platform
	jal movdraw_normal_Platform
	jal movdraw_normal_Platform2
	jal movdraw_normal_Platform3
	jal award  
	jal fire
	jal drawCharacter
	li $v0, 32    # load 32 into register $v0 to trigger the sleep system call
	li $a0, 23  # load the number of milliseconds to sleep into register $a0
	syscall
	
	
	jal clearCharacter2
	jal clearfire
	jal clearaward
	jal clearPlatform
	jal movclearPlatform
	jal movclearPlatform2
	jal movclearPlatform3
	jal drawClouds
	add $s5 $s5 8
