Background: 
	li $t0, DISPLAY_FIRST_ADDRESS   
	li $t1, BACKGROUND
	addi $t6,$t0,16814     
	addi $t7,$t0,16384    
fill_sky:
   beq $t0,$t7, fill_sky_exit
   sw $t1,0($t0)
   add $t0,$t0,4
   j fill_sky
   
fill_sky_exit:
	jr $ra

drawwon:
	li $t0, DISPLAY_FIRST_ADDRESS
	li $t7, LAST_ADDRESS
	la $t1, youwon # load the address of the background array into register $t1
	addi $t1, $t1, 4       # skip the first value (since it's the length of the array)
	addi $t6, $t0, 16814   
	addi $t7, $t0, 16384  

fill_won:
   bgeu $t0, $t7, fill_won_exit   # exit loop if $t0 >= address of last pixel

   lw $t2, 0($t1)       # load the current color value from the array into register $t2
   sw $t2, 0($t0)       # store the color value in the display memory at the current address in register $t0
   
   addi $t1, $t1, 4     # increment the array address pointer by 4 (since each color value is 4 bytes)
   addi $t0, $t0, 4     # increment the display address pointer by 4 (since each pixel is 4 bytes)
   
   j fill_won 
   
fill_won_exit:
	li $s3,0xffff0000
	lw $t8,0($s3)
	beq $t8,1,press_s
	j drawwon

drawgameover:
	li $t0, DISPLAY_FIRST_ADDRESS
	li $t7, LAST_ADDRESS
	la $t1, game_over # load the address of the background array into register $t1
	addi $t1, $t1, 4       # skip the first value (since it's the length of the array)
	addi $t6, $t0, 16814   
	addi $t7, $t0, 16384  

fill_over:
   bgeu $t0, $t7, fill_over_exit   # exit loop if $t0 >= address of last pixel

   lw $t2, 0($t1)       # load the current color value from the array into register $t2
   sw $t2, 0($t0)       # store the color value in the display memory at the current address in register $t0
   
   addi $t1, $t1, 4     # increment the array address pointer by 4 (since each color value is 4 bytes)
   addi $t0, $t0, 4     # increment the display address pointer by 4 (since each pixel is 4 bytes)
   
   j fill_over 
   
fill_over_exit:
	j Exit
		
	
drawStartPage:
	li $t0, DISPLAY_FIRST_ADDRESS
	li $t7, LAST_ADDRESS
	la $t1, start_page # load the address of the background array into register $t1
	addi $t1, $t1, 4       # skip the first value (since it's the length of the array)
	addi $t6, $t0, 16814   
	addi $t7, $t0, 16384  

fill_start:
   bgeu $t0, $t7, fill_start_exit   # exit loop if $t0 >= address of last pixel

   lw $t2, 0($t1)       # load the current color value from the array into register $t2
   sw $t2, 0($t0)       # store the color value in the display memory at the current address in register $t0
   
   addi $t1, $t1, 4     # increment the array address pointer by 4 (since each color value is 4 bytes)
   addi $t0, $t0, 4     # increment the display address pointer by 4 (since each pixel is 4 bytes)
   
   j fill_start 
   
fill_start_exit:
	li $s3,0xffff0000
	lw $t8,0($s3)
	beq $t8,1,press_s
	j drawStartPage
	
